import React from 'react';
import { Button, List, Card, Icon } from 'antd'
import NicknameEditForm from '../components'

const Profile = () => {
  return (
    <>
      <NicknameEditForm />
      <List
        style={{ marginBottom:"20px" }}
        grid={{ gutter: 4, xs: 2, md :3}}
        size="small"
        header={<div>팔로워 목록</div>}
        loadMore={<Button style={{width:"100%"}} type="primary">더 보기</Button>}
        bordered
        dataSource={["마리오소프트", "락차이나", "위워크아웃"]}
        renderItem={item => (
          <List.Item style={{ marginTop:"20px"}}>
            <Card actions={[<Icon type="stop" key="stop" />]}><Card.Meta description={item} /></Card>
          </List.Item>
        )}
      />
      <List
        style={{ marginBottom:"20px" }}
        grid={{ gutter: 4, xs: 2, md :3}}
        size="small"
        header={<div>팔로잉 목록</div>}
        loadMore={<Button style={{width:"100%"}} type="primary">더 보기</Button>}
        bordered
        dataSource={["마리오소프트", "락차이나", "위워크아웃"]}
        renderItem={item => (
          <List.Item style={{ marginTop:"20px"}}>
            <Card actions={[<Icon key="stop" type="stop" />]}><Card.Meta description={item} /></Card>
          </List.Item>
        )}
      />
    </>
  )
}

export default Profile;
